            text-transform: uppercase;
            color: #fff; 
            margin-bottom: 5%;
            font-weight: 200;
            font-size: 15px;
        }
        img {
            width: 100%;
            position: absolute;
            top: 0;
            left: 0;

            height: auto;
        }
